Это ваш пропуск в мир бонусов и персональных скидок.

Получайте за каждую покупку бонусные баллы. Накопленными баллами можно оплачивать до 100% стоимости покупок.


Некоторые товары вы сможете получать в подарок. Например, каждый шестой кофе. Каждый шестой омыватель или каждый десятый хот-дог. А каждая третья автомойка выбранной программы — выгоднее на 50%.

С мобильным приложением Champions club вы сможете:


•	Приобретать электронные абонементы на кофе или автомойку за бонусные баллы;
•	Контролировать начисление и списание баллов; 
•	Получать информацию о всех преимуществах;
•	Узнавать о персональных предложениях, которые будут интересны именно вам;
•	Задавать вопросы и получать консультации;
•	Проверять наличие интересующих вас видов топлива и услуг на АЗС;
